import React from "react"
import ReactDOM from 'react-dom';
import Funcionario from './Funcionario'
import Api from './Api'

const ListaFuncionarios = () => {

    function novoFuncionario(evt) {
        <Funcionario id={null} />
    }

    function editaFuncionario(evt) {
        alert(evt.target.id);
        ReactDOM.render(<Funcionario id={evt.target.id} />, document.getElementById('root'));
        // Api.open('Funcionario');
    }

    function deletaFuncionario(evt) {
        alert(evt.target.id);
    }

    function getListaFuncionarios() {
        let listFuncionario = Api.consultaFuncionarios();

        return listFuncionario.map( funcionario => {
            return <tr id={funcionario.id}>
                <td><input id={funcionario.id} type="button" value="Editar" onClick={editaFuncionario} /></td>
                <td>{funcionario.id}</td>
                <td>{funcionario.nome}</td>
                <td>{funcionario.sobrenome}</td>
                <td><input id={funcionario.id} type="button" value="Excluir" onClick={deletaFuncionario} /></td>
            </tr>
            //  key={funcionario.id} id={funcionario.id} onClick={loadFuncionario}>
            //     {funcionario.id} - {funcionario.nome} - {funcionario.sobrenome} - <input type="button" value="X" onClick={deletaFuncionario} />
            // </li>
        })
    }

    return (
        <div>
            <h1>Funcion√°rios</h1>
            <input type="button" value="Novo" onClick={novoFuncionario} />
            <table heigth='40%'>
                <thead>
                    <td>#</td>
                    <td>ID</td>
                    <td>Nome</td>
                    <td>Sobrenome</td>
                    <td>#</td>
                </thead>
                <tbody overflow="auto">
                    {getListaFuncionarios()}
                </tbody>
            </table>
        </div>
    )
}
export default ListaFuncionarios;
